import React from 'react';
import Head from 'next/head';
import AppLayout from '../components/AppLayout';


const Signup = () => {
    return (
        <>
            <Head>
                <meta charSet="utf-8" />
                <title>Sign-Up</title>
            </Head>

            <AppLayout> Signup</AppLayout>
        </>
    );
};

export default Signup;
